/* eslint-disable jsx-a11y/alt-text */
import "./Profile.css"
import { useState } from "react"
function Profile(){
    // eslint-disable-next-line no-undef
    const[style,setStyle]=useState({
        bgColor:'white',
        color:'black'
    })
    const[user,setUser]=useState({
        name:'rohan',
        gender:'male', email:"rohan@gmail.com",
        img:"data:image/jpeg;base64,",
        des:"I am trained in java, bootstrap,SQL"
    })
    const changeforrohan=(event)=>{
        if(event.target.click){
            setUser({
                name:'rohan',
        gender:'male',
        email:"rohan@gmail.com",
        img:"data:image/jpeg;base64,",
           des:"I am trained in java, bootstrap,SQL"
    })
        }
    }
    const changeforaman=(event)=>{
        if(event.target.click){
            setUser({
                name:'Aman',
        gender:'male',
        email:"aman@gmail.com",
        img:"data:image/jpeg;base64,",
           des:"I am trained in java, javascript, react, html, css"
    })
        }
    }
    const change=(event)=>{
        if(event.target.checked){
            setStyle({
                bgColor:'black',
                color:'white'
            })
        }else{
            setStyle({
                bgColor:'white',
                color:'black'
            })
        }

    }
    return(
        <div>
        <div>
        <div className="container">
            <div className="left">
                {/* // eslint-disable-next-line jsx-a11y/alt-text */}
                <img src={user.img} />
               
                </div>
                
                <div style={{background:style.bgColor,color:style.color}} className="right">
                <h3>Name:{user.name}</h3>
                <h3>Email:{user.email}</h3>
                <h3>Gender:{user.gender}</h3>
                <p>{user.des}</p>
                <label htmlFor="">Check this for dark theme</label>
                <input onChange={change} type="checkbox"/>

            </div>
        </div>
        <button onClick={changeforrohan}>rohan</button>
        <button onClick={changeforaman}>aman</button>
        </div>
        </div>
    )
}

export default Profile
